function getData() {
	console.log(1111)
	let oriData = []
	let desData = []
	let oriCountry = ""
	let desCountry = ""
	let desDiv = document.querySelector("div.to")
	let oriDiv = document.querySelector("div.from")
	let oriItems = [...document.querySelector(".ori-block").children]
	let desItems = [...document.querySelector(".des-block").children]

	if (Array.isArray(oriItems)) {
		for (let i = 1, len = oriItems.length; i < len; i++) {
			let item = oriItems[i]
			if (item && item.querySelector) {
				oriData.push({
					datetime: item.querySelector("time").innerText,
					status: item.querySelector("p").innerText,
				})
			}
		}
	}

	if (Array.isArray(desItems)) {
		for (let i = 1, len = desItems.length; i < len; i++) {
			let item = desItems[i]
			if (item && item.querySelector) {
				desData.push({
					datetime: item.querySelector("time").innerText,
					status: item.querySelector("p").innerText,
				})
			}
		}
	}

	if (desDiv && desDiv.querySelector) {
		desCountry = desDiv.querySelector("span").innerText
	}
	if (oriDiv && oriDiv.querySelector) {
		oriCountry = oriDiv.querySelector("span").innerText
	}

	return {
		ori: oriData,
		des: desData,
		oriCountry: oriCountry,
		desCountry: desCountry,
	}
}

